regionBkVS._virtualQueryString:
function (source, callback) {

   var res = {
       columns: [  "min",  "max",  "mean", "count" ],
       meta:{ "min": 9,  "max": 9,  "mean": 9, "count": 7},
       rows: []
   };
   if(source.rows.length > 0 ){
       var min =  _.minBy(source.rows, "price");
       var max  = _.maxBy(source.rows, "price");
       var mean =  _.meanBy(source.rows, "price");
     res.rows.push({
           min: min ? min.price : 0.0,
           max: max? max.price :0.0,
           mean: mean  ? mean : 0.0,
           count: source.rows.length
       });
   }

    callback(res);

}

